We first define our message type. Abd... in the type refers to the names of the algorithm's original author's -- Attiya, Bar-Noy, and Dolev -- or "ABD." type RequestId = u64;
type Value = char; #[derive(Clone, Debug, Eq, Hash, Ord, PartialEq, PartialOrd)]
#[derive(Serialize, Deserialize)]
enum AbdMsg { Query(RequestId), AckQuery(RequestId, Seq, Value), Replicate(RequestId, Seq, Value), AckReplicate(RequestId),
} The current implementation combines the roles of "replica" and "coordinator that accepts a request and facilitates replication." seq and val are for the first role, while phase tracks information needed by the second role. Of particular note is that for phase 1, writes need to remember what value to later replicate, which is stored in write. Conversely for phase 2, reads need to remember what value to later return to the client, which is stored in read. #[derive(Clone, Debug, Eq, Hash, PartialEq)]
struct AbdState { seq: Seq, val: Value, phase: Option<AbdPhase>,
} #[derive(Clone, Debug, Eq, Hash, PartialEq)]
enum AbdPhase { Phase1 { request_id: RequestId, requester_id: Id, write: Option<Value>, // `None` for read responses: BTreeMap<Id, (Seq, Value)>, }, Phase2 { request_id: RequestId, requester_id: Id, read: Option<Value>, // `None` for write acks: BTreeSet<Id>, },
} type Seq = (LogicalClock, Id); // `Id` for uniqueness
type LogicalClock = u64; We are now ready to implement the protocol. Note that the implementation intentionally avoids decomposing the message handlers into different function calls because each call needs to manage shared actor state. Spreading state mutation across multiple locations in the source code arguably makes the implementation harder to follow (much like mutable global variables), and functions are only used where they can be reasoned about locally. An alternative composition strategy that does often work well for actor systems involves distinguishing roles so that each has less state (having different AbdServer and AbdReplica actors for example), although we will not do that for this short example. The next chapter on the other hand will demonstrate how to compose a system of different actor types. #[derive(Clone)]
struct AbdActor { peers: Vec<Id>,
