struct TwoPhaseState { rm_state: Vec<RmState>, tm_state: TmState, tm_prepared: Vec<bool>, msgs: BTreeSet<Message>,
} Types in the TLA+ spec are conveyed via an invariant that is passed to its model checker, TLC. Message == [type : {"Prepared"}, rm : RM] \cup [type : {"Commit", "Abort"}] TypeOK == /\ rmState \in [RM -> {"working", "prepared", "committed", "aborted"}] /\ tmState \in {"init", "committed", "aborted"} /\ tmPrepared \subseteq RM /\ msgs \subseteq Message #[derive(Clone, Debug, Eq, Hash, Ord, PartialEq, PartialOrd)]
enum Message { Prepared { rm: R }, Commit, Abort } #[derive(Clone, Debug, Eq, Hash, PartialEq)]
enum RmState { Working, Prepared, Committed, Aborted } #[derive(Clone, Debug, Eq, Hash, PartialEq)]
enum TmState { Init, Committed, Aborted } TLA+ leverages temporal logic to convey the specification, while Stateright requires that a trait is implemented. One other distinct aspect is that Stateright actions are also types. Spec == Init /\ [][Next]_<<rmState, tmState, tmPrepared, msgs>> #[derive(Clone, Debug)]
enum Action { TmRcvPrepared(R), TmCommit, TmAbort, RmPrepare(R), RmChooseToAbort(R), RmRcvCommitMsg(R), RmRcvAbortMsg(R),
} impl Model for TwoPhaseSys { type State = TwoPhaseState; type Action = Action; ...
} The initial aggregate state is one where the resource mangers are ready to start a transaction; the sole transaction manager is ready to start a transaction; the transaction manager's view of each resource manager indicates that none have indicated that they are preparing a transaction; and the network is an empty set. Note that set semantics provide an ideal model for a network in this case because they capture the fact that networks rarely make guarantees about message order. Those guarantees must be imposed by additional protocols. And keep in mind that often those protocols only provide guarantees under limited scopes (e.g. TCP only orders messages within the lifetime of that connection, so a transient network partition can still cause message redelivery with TCP). Init == /\ rmState = [rm \in RM |-> "working"] /\ tmState = "init" /\ tmPrepared = {} /\ msgs = {} fn init_states(&self) -> Vec<Self::State> { vec![TwoPhaseState { rm_state: self.rms.clone().map(|_| RmState::Working).collect(), tm_state: TmState::Init, tm_prepared: self.rms.clone().map(|_| false).collect(), msgs: Default::default(), }]
