struct ServerActor; impl Actor for ServerActor { type Msg = RegisterMsg<RequestId, char, ()>; type State = char; fn on_start(&self, _id: Id, _o: &mut Out<Self>) -> Self::State { '?' // default value for the register } fn on_msg(&self, _id: Id, state: &mut Cow<Self::State>, src: Id, msg: Self::Msg, o: &mut Out<Self>) { match msg { RegisterMsg::Put(req_id, value) => { *state.to_mut() = value; o.send(src, RegisterMsg::PutOk(req_id)); } RegisterMsg::Get(req_id) => { o.send(src, RegisterMsg::GetOk(req_id, **state)); } _ => {} } }
} A test follows. The test checks the system for a property called linearizability , which loosely speaking means that the visible behavior of the register emulated by the actor system is identical to that of a register within a single-threaded system. In the words of the individuals who coined the term: Linearizability provides the illusion that each operation applied by concurrent processes takes effect instantaneously at some point between its invocation and its response, implying that the meaning of a concurrent objectâ€™s operations can be given by pre- and post-conditions. Maurice Herlihy and Jeannette Wing, in Linearizability: A Correctness Condition for Concurrent Objects An important aspect of linearizability is the notion of a "sequential specification," which serves as a reference for correct behavior of the system. In other words, the system emulates the sequential specification. For instance, the sequential specification could indicate: the system behaves like a memory cell (i.e. register semantics), the system behaves like a queue, or the system behaves like a stack. That means that when someone indicates that a system is linearizable, it is important to keep in mind the question "linearizable with respect to what ?" In this chapter, the sequential specification is register semantics, provided by Stateright, but later chapters will involve other sequential specifications. The test leverages RegisterActor , which is built into Stateright and defines a kind of test fixture in which clients (only 1 in this case) write distinct values and independently read values without coordinating with one another. #[test] fn is_unfortunately_not_linearizable() { let checker = ActorModel::new( (), LinearizabilityTester::new(Register('?')) ) .actor(RegisterActor::Server(ServerActor)) .actor(RegisterActor::Client { put_count: 2, server_count: 1 }) .property(Expectation::Always, "linearizable", |_, state| { state.history.serialized_history().is_some() }) .property(Expectation::Sometimes, "get succeeds", |_, state| { state.network.iter().any(|e| matches!(e.msg, RegisterMsg::GetOk(_, _))) }) .property(Expectation::Sometimes, "put succeeds", |_, state| { state.network.iter().any(|e| matches!(e.msg, RegisterMsg::PutOk(_))) }) .record_msg_in(RegisterMsg::record_returns) .record_msg_out(RegisterMsg::record_invocations) .checker().spawn_dfs().join(); //checker.assert_properties(); // TRY IT: Uncomment this line, and the test will fail. checker.assert_discovery("linearizable", vec![ Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') }, Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(1) }, Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(2, 'Z') }, Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(2) }, Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') }, Deliver { src: Id::from(1), dst: Id::from(0), msg: Get(3) }, Deliver { src: Id::from(0), dst: Id::from(1), msg: GetOk(3, 'A') }, ]); } Stateright is able to find a bug that arises even if there is only a single client. The test indicates a sequence of steps that trigger the bug (AKA a Path ), but in practice you would normally just call checker.assert_properties(), and Stateright would fail the test while indicating steps that reproduce the bug (although the specific example that it finds can vary). The actor with Id 0 is the server while the actor with Id 1 is the client. For brevity, the example shows actor inputs (Deliver) but not outputs. sequence diagram for the linearizability violation The server receives a Put from the client with value 'A', which it acknowledges. The client receives the PutOk acknowledgement and in turn sends a second Put with a new value, 'Z' (not shown yet since the test indicates message deliveries only, not message sends). Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') },
Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(1) }, The server receives the second Put, which it acknowledges. The client receives the PutOk acknowledgement and in turn sends a Get request (not shown yet), expecting to read 'Z'. Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(2, 'Z') },
Deliver { src: Id::from(0), dst: Id::from(1), msg: PutOk(2) }, The network redelivers the first write, inadvertently overwriting the second: Deliver { src: Id::from(1), dst: Id::from(0), msg: Put(1, 'A') }, The server receives the earlier Get request and replies with 'A'. The client receives the unexpected value, which violates linearizability because from the perspective of the client, the system is not behaving as a single-threaded register. Deliver { src: Id::from(1), dst: Id::from(0), msg: Get(3) },
Deliver { src: Id::from(0), dst: Id::from(1), msg: GetOk(3, 'A') }, The last bit of code defines the main method, which allows you to run the actor on UDP port 3000, encoding messages with the JSON format. fn main() { env_logger::init_from_env(env_logger::Env::default().default_filter_or("info")); spawn( serde_json::to_vec, |bytes| serde_json::from_slice(bytes), vec![ (SocketAddrV4::new(Ipv4Addr::LOCALHOST, 3000), ServerActor) ]).unwrap();
}

