Confirm the system behaves as expected by running the test, which should pass because the test asserts that the bug exists. Include the --release flag so that Rust fully optimizes the code even during testing, as Stateright tests are computationally intensive and can be time consuming. cargo test --release Now run the actor on a UDP socket. cargo run --release If using a POSIX-oriented operating system, netcat can be used to interact with the actor from a different terminal window. Actor responses are omitted from the listing below for clarity, but you will see messages such as {"PutOk":0} printed to STDOUT. Numbers in the messages are request IDs, the importance of which will be more evident in the next chapter. nc -u localhost 3000
